import React from 'react';
import './Nav.css'

const Nav = () => {
	return(
	<div className="avenir">
		<nav className="list">
			<ul className="flex">
				<li><a href="#">CEC</a>
					<ul>
						<li><a href="#">voting</a></li>
						<li><a href="#">elections</a></li>
						<li><a href="#">meeting</a></li>
					</ul>
				</li>
				<li><a href="#">LEG</a></li>
				<li><a href="#">about</a></li>
				<li><a href="#">other stuff</a></li>
				<li><a href="#">moar</a></li>
			</ul>
		</nav>
	</div>
	);
};

export default Nav;
